import "./App.css";

import { Cards, Chart, CountryPicker } from "./components";
import styles from "./App.module.css";
import { fetchData } from "./api";
import { useEffect } from "react";

const App = () => {
  let [data, setData] = {};

  useEffect(() => {
    const getData = async () => {
      const data = await fetchData();

      setData(data);
    };

    getData();
  }, []);

  return (
    <div className={styles.container}>
      <Cards />
      <CountryPicker />
      <Chart />
    </div>
  );
};

export default App;
